import com.advancedspark.spark.ml.image.ImageIO
import org.apache.spark.mllib.linalg.Vectors

val imagePathsRDD = sc.wholeTextFiles(inputImagesPath).map {
  case (path, content) => path.replace("file:", "")
}

val imagesAsPixelVectorsRDD = imagePathsRDD.map(imagePath => {
  Vectors.dense(ImageIO.extractAndScalePixelArray(imagePath, scaledWidth, scaledHeight))
})
